import React from 'react'
import ProductCard from '../../components/ProductCard/ProductCard';

export default function Homepage() {
  return (
	<div>
	  <div className='container mt-5'>
		<div className='row'>
			<div className='col-3'>
				<ProductCard/>
			</div>
		</div>
	  </div>
	</div>
  )
}
